        public void WriteToExcel(string outputName)
        {
            FileInfo newFile = new FileInfo(outputName);
            ExcelPackage pck = new ExcelPackage(newFile);       

            //Add the Content sheet
            ExcelWorksheet ws = AddWorksheet(pck.Workbook, this.name);

            PrepWorksheet(ws);
            int rowNumber = 2;

            ws.DefaultColWidth = 16;
            ExcelColumn col = ws.Column(1);

            col.Width = 40;

            foreach (object result in this.clashresults)
            {
                if (result.GetType() == typeof(clashgroup))
                {
                    clashgroup clashGroup = result as clashgroup;
                    ExcelRow row = ws.Row(rowNumber);
                    row.Height = 200;

                    ws.Cells["A" + rowNumber].Value = clashGroup.href;
                    ws.Cells["B" + rowNumber].Value = clashGroup.name;
                    
                    ws.Cells["C" + rowNumber].Value = clashGroup.status.ToString();
                    if (clashGroup.comments.Count != 0)
                    {
                        ws.Cells["D" + rowNumber].Value = clashGroup.comments[0].body;
                    }

                    ws.Cells["E" + rowNumber].Value = clashGroup.createddate.date.Date.ToShortDateString();
                    ws.Cells["F" + rowNumber].Value = clashGroup.approveddate.date.Date.ToShortDateString();
                    ws.Cells["G" + rowNumber].Value = GetPosition(clashGroup);

                    FileInfo image = new FileInfo(Path.Combine(reportDirectory, clashGroup.href));

                    if (image != null)
                    {
                        List<string> drawingsNames = new List<string>();
                        foreach (ExcelDrawing drawing in ws.Drawings)
                        {
                            drawingsNames.Add(drawing.Name);
                        }

                        ExcelPicture pic;
                        if (drawingsNames.Contains(clashGroup.href))
                        {
                            pic = ws.Drawings.AddPicture(GetNextFilename(clashGroup.href + numberPattern), image);
                        }
                        else
                        {
                            pic = ws.Drawings.AddPicture(clashGroup.href, image);
                        }
                        
                        pic.SetPosition(rowNumber - 1, 0, 0, 0);
                        double ratio = row.Height * 2.66667 * 100 / pic.Image.Size.Height;
                        pic.SetSize(Convert.ToInt16(Math.Round(ratio, 0)));
                    }
                }

                rowNumber++;
            }

            pck.Save();
        }

        private string GetPosition(clashgroup clashGroup)
        {
            List<string> gridLocations = new List<string>();

            foreach (clashresult result in clashGroup.clashresults)
            {
                if (!gridLocations.Contains(result.gridlocation))
                {
                    gridLocations.Add(result.gridlocation);
                }
            }

            string position = "";
            foreach (string location in gridLocations)
            {
                position = position + location + ";";
            }
            position.TrimEnd(';');

            return position;
        }

        private ExcelWorksheet AddWorksheet(ExcelWorkbook workbook, string name)
        {
            Dictionary<string, ExcelWorksheet> workSheets = new Dictionary<string, ExcelWorksheet>();

            foreach (ExcelWorksheet worksheet in workbook.Worksheets)
            {
                workSheets.Add(worksheet.Name, worksheet);
            }

            if (workSheets.ContainsKey(name))
            {
                MessageBoxResult result = MessageBox.Show("The report " + name + " is already there, do you want to override it ?", "Create report", MessageBoxButton.YesNo);
                switch (result)
                {
                    case MessageBoxResult.Yes:
                        workSheets[name].View.ShowGridLines = false;
                        return workSheets[name];
                    case MessageBoxResult.No:
                        string newName = GetNextFilename(name + numberPattern);
                        ExcelWorksheet ws = workbook.Worksheets.Add(newName);
                        ws.View.ShowGridLines = false;
                        return ws;
                    default:
                        return null;
                }
            }
            else
            {
                ExcelWorksheet ws = workbook.Worksheets.Add(name);
                ws.View.ShowGridLines = false;
                return ws;
            }
        }
        private string numberPattern = " ({0})";
        private string GetNextFilename(string pattern)
        {
            string tmp = string.Format(pattern, 1);
            if (tmp == pattern)
                throw new ArgumentException("The pattern must include an index place-holder", "pattern");

            if (!File.Exists(tmp))
                return tmp; // short-circuit if no matches

            int min = 1, max = 2; // min is inclusive, max is exclusive/untested

            while (File.Exists(string.Format(pattern, max)))
            {
                min = max;
                max *= 2;
            }

            while (max != min + 1)
            {
                int pivot = (max + min) / 2;
                if (File.Exists(string.Format(pattern, pivot)))
                    min = pivot;
                else
                    max = pivot;
            }

            return string.Format(pattern, max);
        }

        private void PrepWorksheet(ExcelWorksheet ws)
        {
            //Headers
            ws.Cells["A1"].Value = "Picture";
            ws.Cells["B1"].Value = "Name";
            ws.Cells["C1"].Value = "Status";
            ws.Cells["D1"].Value = "Comment";
            ws.Cells["E1"].Value = "Creation Date";
            ws.Cells["F1"].Value = "Approbation Date";
            ws.Cells["G1"].Value = "Grid Location";
            ws.Cells["H1"].Value = "Level";
            ws.Cells["A1:H1"].Style.Font.Bold = true;
        }

